import React, { useState,useEffect } from "react";
import './Header.css'
import Button from '@mui/material/Button';
import SearchIcon from '@mui/icons-material/Search'
import LocationCityOutlined from "@mui/icons-material/LocalActivityOutlined";


const Header = () => {
    return(
    <section class="header">
    <input type="checkbox" name="" id="toggler"></input>
    <label for="toggler" class="fas fa-bars"></label>
    <a href="#" class="logo">2T Store<span>.</span></a>
    <nav class="navbar">
        <Button href="index.html">Trang Chủ</Button>
        <Button href="Shop.html">Shop</Button>
        <Button href="GioiThieu.html">Giới Thiệu</Button>
        <Button href="LienHe.html">Liên Hệ</Button>
        <Button href="Blog.html">Blog</Button>
        <Button href="Login.html">Đăng Ký/Đăng Nhập </Button>
    </nav>
    <div class="icons">
        <a href="#" class="fas fa-heart"></a>
        <a href="#" class="fas fa-shopping-cart"></a>
        <a href="#" class="fas fa-solid fa-user"></a>
    </div>
</section>
    );
}
export default Header;
